import productsData from "../Data/productsData"

const ProductImages = () => {
    
    return (
        <div className="product-images">
          {productsData.map((images) => (
            <div>
              <img src={images} images={images} />
            </div>
          ))}
        </div>
      );
}

export default ProductImages;
